if(!$Kaonashi -or $Kaonashi -eq "False") { $Kaonashi = "False" ; $KaonashiColor = "Red" } else { $KaonashiColor = "Green" }
if(!$Kaonashi_WPA -or $Kaonashi_WPA -eq "False") { $Kaonashi_WPA = "False" ; $Kaonashi_WPAColor = "Red" } else { $Kaonashi_WPAColor = "Green" }
if(!$Rockyou -or $Rockyou -eq "True") { $Rockyou = "True" ; $RockyouColor = "Green" } else { $RockyouColor = "Green" }
if(!$OneRule -or $OneRule -eq "False") { $OneRule = "False" ; $OneRuleColor = "Red" } else { $OneRuleColor = "Green" }
if(!$VPSMode -or $VPSMode -eq "False") { $VPSMode = "False" ; $VPSModeColor = "Red" } else { $VPSModeColor = "Green" }
if(!$SshHost -or $SshHost -eq "None") { $SshHost = "None" ; $SshHostColor = "Red" } else { $SshHostColor = "Green" }
if(!$SshPort -or $SshPort -eq "None") { $SshPort = "None" ; $SshPortColor = "Red" } else { $SshPortColor = "Green" }
if(!$SshUser -or $SshUser -eq "None") { $SshUser = "None" ; $SshUserColor = "Red" } else { $SshUserColor = "Green" }
