function Show-Help {
    Write-Host
    Write-Host "This script allows you to run a Cloudtopolis client using your own hardware." -ForegroundColor White
    Write-Host "You only need to fill in the fields that appear on the screen and run the program." -ForegroundColor White
    Write-Host "The settings are saved persistently, so you only need to do this once." -ForegroundColor White
    Write-Host "This client has been designed for Windows using PowerShell 4.0 or above." -ForegroundColor White
    Write-Host
    Write-Host "If you need another client or more information, see the readme file on the GitHub page:" -ForegroundColor White
    Write-Host "https://github.com/JoelGMSec/Cloudtopolis" -ForegroundColor Blue
    Write-Host ; pause }
	
function Install-7zip {
    if (!(Get-Command Expand-7Zip -ErrorAction Ignore)) { Install-Package -Scope CurrentUser -Force 7Zip4PowerShell > $null }}

function Invoke-Check { 
    if(!$Voucher -or $Voucher -eq "None") { & $NoVoucher ; Main-Menu } else { & $Running Start-Sleep 2 ; Clear-Host ; Show-Banner
    & $GpuName ; $Host.UI.RawUI.ForegroundColor = 'White' ; $GetGPU = (Get-WmiObject Win32_VideoController).Name
    if (!$GetGPU) { & $NoGPU } else { $GetGPU }}}

function Download-Files {
    $Host.UI.RawUI.ForegroundColor = 'White' ; cd $localpath\Cloudtopolis\content

    if ($Kaonashi -eq "True") {
    & $KaonashiCheck ; $KaonashiLocal = Test-Path kaonashi.txt
    if (!$KaonashiLocal) { Write-Host "Kaonashi not found!" ; & $MegaTools
    (New-object System.net.webclient).DownloadFile("https://raw.githubusercontent.com/JoelGMSec/Cloudtopolis/master/Client/megatools.exe","megatools.exe")
    Write-Host "Done!" ; & $DownloadKaonashi ; Write-Host "WARNING: This can take some time.."
    ..\megatools.exe dl --no-progress 'https://mega.nz/#!nWJXzYzS!P1G8HDiMxq5wFaxeWGWx334Wp9wByj5kMEGLZkVX694' --path $pwd 
    Write-Host "Extracting wordlist.." ; Install-7zip ; Expand-7Zip .\kaonashi.7z $pwd ; del .\kaonashi.7z }
    else { Write-Host "Kaonashi found! Skipping.." }}

    if ($Kaonashi_WPA -eq "True") {
    & $Kaonashi_WPACheck ; $Kaonashi_WPALocal = Test-Path kaonashiWPA100M.txt
    if (!$Kaonashi_WPALocal) { Write-Host "Kaonashi_WPA not found!" ; & $MegaTools
    (New-object System.net.webclient).DownloadFile("https://raw.githubusercontent.com/JoelGMSec/Cloudtopolis/master/Client/megatools.exe","megatools.exe")
    Write-Host "Done!" ; & $DownloadKaonashi_WPA ; Write-Host "WARNING: This can take a little.."
    ..\megatools.exe dl --no-progress 'https://mega.nz/#!jeRRgQgZ!xcRcLpm0ftuu7z7JN32LHMECqk9vmpVNH2JFVxSICfU' --path $pwd 
    Write-Host "Extracting wordlist.." ; Install-7zip ; Expand-7Zip .\kaonashiWPA100M.7z $pwd ; del .\kaonashiWPA100M.7z }
    else { Write-Host "Kaonashi_WPA found! Skipping.." }}

    if ($Rockyou -eq "True") { 
    & $RockyouCheck ; $RockyouLocal = Test-Path rockyou.txt
    if (!$RockyouLocal) { Write-Host "Rockyou not found!" ; & $DownloadRockyou
    Invoke-WebRequest -UseBasicParsing "https://download.weakpass.com/wordlists/90/rockyou.txt.gz" -OutFile rockyou.txt.gz
    Write-Host "Extracting wordlist.." ; Install-7zip ; Expand-7Zip .\rockyou.txt.gz $pwd ; del .\rockyou.txt.gz }
    else { Write-Host "Rockyou found! Skipping.." }}

    if ($OneRule -eq "True") {
    & $OneRuleCheck ; $OneRuleLocal = Test-Path OneRuleToRuleThemAll.rule
    if (!$OneRuleLocal) { Write-Host "OneRule not found!" ; & $DownloadOneRule
    Invoke-WebRequest -UseBasicParsing "https://raw.githubusercontent.com/NotSoSecure/password_cracking_rules/master/OneRuleToRuleThemAll.rule" -OutFile OneRuleToRuleThemAll.rule
    Write-Host "Done!" } else { Write-Host OneRule found! Skipping.. }}}

function Run-Program {
    $Host.UI.RawUI.ForegroundColor = 'White' ; cd $localpath\Cloudtopolis ; 
    $DecodedBase64 = $SecurePass.ToCharArray() ; [array]::Reverse($DecodedBase64) ; -join $DecodedBase64 2>&1> $null
    $DecodedSecurePass = [System.Text.Encoding]::UTF8.GetString([System.Convert]::FromBase64String("$DecodedBase64"))
    (New-object System.net.webclient).DownloadFile("https://raw.githubusercontent.com/JoelGMSec/Cloudtopolis/master/Client/Cloudtopolis.exe","Cloudtopolis.exe")
    try { & $Connecting ; if(!$VPSMode -or $VPSMode -eq "False") { & $CloudShell } 
    else { & $NoCloudShell ; $Content = [System.Convert]::FromBase64String($plink) ; Set-Content -Path "plink.exe" -Value $Content -Encoding Byte -Force 2>&1> $null
	Start-Process powershell.exe -NoNewWindow "echo y | .\plink.exe -ssh $SshUser@$SshHost -P $SshPort -pw $DecodedSecurePass -N -C -L 8000:localhost:8000 2>&1> `$null" }
    & $DownAndRun ; .\Cloudtopolis.exe --url http://localhost:8000/api/server.php --voucher $Voucher } finally { & $Pkill }}

function ConvertFrom-SecureToPlain {
    param([Parameter(Mandatory=$true)][System.Security.SecureString] $SecurePassword)
    $PasswordPointer = [Runtime.InteropServices.Marshal]::SecureStringToBSTR($SecurePassword)
    $PlainTextPassword = [Runtime.InteropServices.Marshal]::PtrToStringAuto($PasswordPointer)
    [Runtime.InteropServices.Marshal]::ZeroFreeBSTR($PasswordPointer) ; $PlainTextPassword }

function Main-Menu {
    do { Show-Banner ; Show-Menu

        $Host.UI.RawUI.ForegroundColor = 'White' ; & $Question
        $Random = New-Object System.Random ; "Select your option:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
        $Host.UI.RawUI.ForegroundColor = 'Green' ; $input = $Host.UI.ReadLine() ; switch ($input) {

        '1' { $Option = 'Voucher' }
        '2' { $Option = 'Kaonashi' }
        '3' { $Option = 'Kaonashi_WPA' }
        '4' { $Option = 'Rockyou' }
        '5' { $Option = 'OneRule' }
        '6' { $Option = 'VPSMode' }
        'V' { $VPSMenu = 'True' }
        'H' { Show-Help }
        'R' { Invoke-Check ; Download-Files ; Run-Program }
        'X' { & $Exiting }

        default { Write-Host ; Write-Host "[!] Wrong option, please try again" -ForegroundColor Red ; Start-Sleep -milliseconds 2000 }}}

	until ($input -ne 'x')

if($VPSMenu -eq "True") { Show-Banner ; VPS-Options

        $Host.UI.RawUI.ForegroundColor = 'White' ; $VPSMenu = 'False' ; & $Question
        $Random = New-Object System.Random ; "Select your option:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
        $Host.UI.RawUI.ForegroundColor = 'Green' ; $input = $Host.UI.ReadLine() ; switch ($input) {

        '1' { $Option = 'SshHost' }
        '2' { $Option = 'SshPort' }
        '3' { $Option = 'SshUser' }
        '4' { $Option = 'SshPass' }
        'M' { Main-Menu }
        'H' { Show-Help }
        'R' { Invoke-Check ; Download-Files ; Run-Program }
        'X' { & $Exiting }

        default { Write-Host ; Write-Host "[!] Wrong option, please try again" -ForegroundColor Red ; Start-Sleep -milliseconds 2000 }}}

# Set Options
if($Option) { Write-Host ; & $Question ; $Host.UI.RawUI.ForegroundColor = 'White'
$Random = New-Object System.Random ; "Enter desired value:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
$Host.UI.RawUI.ForegroundColor = 'Green' ; $cursortop = [System.Console]::get_CursorTop() ; 

if($input) { 
if($input -eq 4) { if($Option -in 'Rockyou') { $Data = $Host.UI.ReadLine() } else { $Data = $Host.UI.ReadLineAsSecureString() }}
else { $Data = $Host.UI.ReadLine() }}

if(!$Data){ [Console]::SetCursorPosition(0,"$cursortop") ; & $Question ; Write-Host "Enter desired value:` " -ForegroundColor White }

if($Option -in 'Voucher') { $Voucher = $Data ; $Option = "Voucher" ; if(($Data -eq "None") -or ($Data = $null)) { $VoucherColor = "Red" } else { $VoucherColor = "Green" } ; & $DataOk }
if($Option -in 'Voucher') { Write-Output "`$Voucher=`"$Voucher`"" >> Cloudtopolis\Cloudtopolis.cfg ; $Option = $null } 

if($Option -in 'Kaonashi') { $Kaonashi = $Data ; $Option = "Kaonashi" ; if(($Data -eq "False") -or ($Data = $null)) { $KaonashiColor = "Red" } else { $KaonashiColor = "Green" } ; & $DataOk }
if($Option -in 'Kaonashi') { Write-Output "`$Kaonashi=`"$Kaonashi`"" >> Cloudtopolis\Cloudtopolis.cfg ; $Option = $null } 

if($Option -in 'Kaonashi_WPA') { $Kaonashi_WPA = $Data ; $Option = "Kaonashi_WPA" ; if(($Data -eq "False") -or ($Data = $null)) { $Kaonashi_WPAColor = "Red" } else { $Kaonashi_WPAColor = "Green" } ; & $DataOk }
if($Option -in 'Kaonashi_WPA') { Write-Output "`$Kaonashi_WPA=`"$Kaonashi_WPA`"" >> Cloudtopolis\Cloudtopolis.cfg ; $Option = $null } 

if($Option -in 'Rockyou') { $Rockyou = $Data ; $Option = "Rockyou" ; if(($Data -eq "False") -or ($Data = $null)) { $RockyouColor = "Red" } else { $RockyouColor = "Green" } ; & $DataOk }
if($Option -in 'Rockyou') { Write-Output "`$Rockyou=`"$Rockyou`"" >> Cloudtopolis\Cloudtopolis.cfg ; $Option = $null } 

if($Option -in 'OneRule') { $OneRule = $Data ; $Option = "OneRule" ; if(($Data -eq "False") -or ($Data = $null)) { $OneRuleColor = "Red" } else { $OneRuleColor = "Green" } ; & $DataOk }
if($Option -in 'OneRule') { Write-Output "`$OneRule=`"$OneRule`"" >> Cloudtopolis\Cloudtopolis.cfg ; $Option = $null }}

if($Option -in 'VPSMode') { $VPSMode = $Data ; $Option = "VPSMode" ; if(($Data -eq "False") -or ($Data = $null)) { $VPSModeColor = "Red" } else { $VPSModeColor = "Green" } ; & $DataOk }
if($Option -in 'VPSMode') { Write-Output "`$VPSMode=`"$VPSMode`"" >> Cloudtopolis\Cloudtopolis.cfg ; $Option = $null } 

if($Option -in 'SshHost') { $SshHost = $Data ; $Option = "SshHost" ; if(($Data -eq "None") -or ($Data = $null)) { $SshHostColor = "Red" } else { $SshHostColor = "Green" } ; & $DataOk }
if($Option -in 'SshHost') { Write-Output "`$SshHost=`"$SshHost`"" >> Cloudtopolis\Cloudtopolis.cfg ; $Option = $null } 

if($Option -in 'SshPort') { $SshPort = $Data ; $Option = "SshPort" ; if(($Data -eq "None") -or ($Data = $null)) { $SshPortColor = "Red" } else { $SshPortColor = "Green" } ; & $DataOk }
if($Option -in 'SshPort') { Write-Output "`$SshPort=`"$SshPort`"" >> Cloudtopolis\Cloudtopolis.cfg ; $Option = $null } 

if($Option -in 'SshUser') { $SshUser = $Data ; $Option = "SshUser" ; if(($Data -eq "None") -or ($Data = $null)) { $SshUserColor = "Red" } else { $SshUserColor = "Green" } ; & $DataOk }
if($Option -in 'SshUser') { Write-Output "`$SshUser=`"$SshUser`"" >> Cloudtopolis\Cloudtopolis.cfg ; $Option = $null } 

if($Option -in 'SshPass') { $SshPass = $Data ; $Option = "SshPass" ; if(($Data -eq "None") -or ($Data = $null)) { $SshPassColor = "Red" } else { $SshPassColor = "Green" } ; & $DataOk }
if($Option -in 'SshPass') { $Password = ConvertFrom-SecureToPlain $SshPass ; $SecurePass = $Password ; $length = $Password.get_Length()
$minuslength = $length - 4 ; $str = "*" * $minuslength ; $SshPass = $str+$Password.Substring($Password.get_Length()-4) ; $Option ="SshPass" }

if($Option -in 'SshPass') { Write-Output "`$SshPass=`"$SshPass`"" >> Cloudtopolis\Cloudtopolis.cfg ; $base64 = [Convert]::ToBase64String([Text.Encoding]::UTF8.GetBytes("$SecurePass"))
$base64array = $base64.ToCharArray() ; [array]::Reverse($base64array) ; $SecurePass = -join $base64array ; Write-Output "`$SecurePass=`"$SecurePass`"" >> Cloudtopolis\Cloudtopolis.cfg
$Option = $null }

# Repeat Operation
if($input -eq 'x') { & $Exiting } else  { Main-Menu }}

# Main Function
New-Item -ItemType "directory" -Path "$pwd\Cloudtopolis" -Force 2>&1> $null ; New-Item -ItemType "directory" -Path "$pwd\Cloudtopolis\content" -Force 2>&1> $null
Main-Menu
